import React, { useEffect, useState } from 'react';
import './App.css';
import LandingPage from "./pages/LandingPage";
import TopMenu from "./components/TopMenu";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MapPage from "./pages/MapPage";
import IntroPage from "./pages/IntroPage";
import LoginPage from "./pages/LoginPage";
import NoticePage from "./pages/NoticePage";
import CommunityPage from "./pages/CommunityPage";
import CreatePostPage from "./pages/CreatePostPage";
import axios from "axios";
import NoticeDetailPage from "./pages/NoticeDetailPage";
import PostDetailPage from "./pages/PostDetailPage";
import { ppost } from "./util/communitydata";
import MyPage from "./pages/MyPage";
import EditProfilePage from "./pages/EditProfilePage";
import SignupPage from "./pages/SignupPage";
import { Post } from "./interface/posts";

function App() {
    const [selectedPlace, setSelectedPlace] = useState<{ lat: number, lng: number } | null>(null);
    const [posts, setPosts] = useState<Post[]>([]);

    useEffect(() => {
        axios.get(`http://3.37.252.66:8080/index/articles`)
            .then(response => {
                if (response.status === 200) {
                    setPosts(response.data);
                } else {
                    alert('Post get failed. Please try again.');
                }
            })
            .catch(error => {
                alert(`Error: ${error.response?.data || 'Request failed'}`);
            });
    }, []);

    const [login, setLogin] = useState(false);

    return (
        <Router>
            <div className="App">
                <TopMenu login={login} setLogin={setLogin} />
                <Routes>
                    <Route path="/" element={<LandingPage login={login} setLogin={setLogin} />} />
                    <Route path="/map" element={<MapPage selectedPlace={selectedPlace} login={login} setLogin={setLogin} />} />
                    <Route path="/intro" element={<IntroPage />} />
                    <Route path="/login" element={<LoginPage />} />
                    <Route path="/signup" element={<SignupPage />} />
                    <Route path="/notices" element={<NoticePage />} />
                    <Route path="/community" element={<CommunityPage posts={ppost} />} />
                    <Route path="/community/post" element={<CreatePostPage setSelectedPlace={setSelectedPlace} addPost={setPosts} />} />
                    <Route path="/notice/:id" element={<NoticeDetailPage />} />
                    <Route path="/post/:id" element={<PostDetailPage posts={posts} />} />
                    <Route path="/mypage" element={<MyPage />} />
                    <Route path="/mypage/edit" element={<EditProfilePage />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
